export interface ICard {
  imgUrl: string;
  title: string;
}

const url = "https://i1.sndcdn.com/artworks-000635780677-yhmbpw-t500x500.jpg";

export const Cards: ICard[] = [
  { imgUrl: url, title: "Для авто" },
  { imgUrl: url, title: "Здоровье" },
  { imgUrl: url, title: "Развлечения" },
  { imgUrl: url, title: "Бьюти" },
  { imgUrl: url, title: "Ремонт" },
  { imgUrl: url, title: "Услуги" },
  { imgUrl: url, title: "Торговля" },
  { imgUrl: url, title: "Образование" },
  { imgUrl: url, title: "Продукты" },
  { imgUrl: url, title: "Туризм" },
  { imgUrl: url, title: "Связь" },
  { imgUrl: url, title: "Товары" },
];
